import React, {Component} from 'react';
import {Line} from 'react-chartjs-2';
import useWindowDimensions from './ScreenSizeDetect';

class EnergyGraph extends Component{

    constructor(props) {
        super(props);
        this.state = {
            energygraphData: {

                labels: ['8 AM', '9 AM', '10 AM', '11 AM', '12 PM', '1 PM', '2 PM', '3 PM', '4 PM', '5 PM', '6 PM', 
                '7 PM', '8 PM', '9 PM', '10 PM', '11 PM', '12 AM'],

                datasets: [
                    {
                        label: 'Task Switches',
                        data: [
                            11,
                            16,
                            18,
                            16,
                            14,
                            9,
                            2,
                            3,
                            4,
                            12,
                            18,
                            22,
                            24,
                            26,
                            23,
                            22,
                            18
                        ]
                    }
                ]
            }
        }
    }

    render(){
        return (
            <div className = "energy-graph">
                <Line
                    data = {this.state.energygraphData}
                    width = {width * 5/6}
                    options = {{
                        maintainAspectRatio: false
                    }}
                />
            </div>
        )
    }
}

export default EnergyGraph;
